import React from 'react';

const Counts = () => {
    return (
        <div>
            <div className="counts">
                <p className="moves">
                    Moves: 0
                </p>
                <p className="time">
                    Time: 00:00
                </p>
            </div>
        </div>
    );
};

export default Counts;
